    for j in range(i, len(nums)):
        if nums[i] > nums[j]:
            break
    for k in range(j, len(nums)):
        if nums[i] > nums[k]:
            break
    return perm([nums[i], nums[k]]) + perm([nums[j], nums[k]]) + perm([nums[i], nums[j]])

