class KruskalMST:
    def __init__(self, n_points: int):
        self.graph = collections.defaultdict(set)
        self.mst_tree = []
        for i in range(n_points):
            for j in range(i + 1, n_points):
                self.graph[i].add(j)
                self.graph[j].add(i)

    def find_parent(self, parent: Dict[int, int], i: int) -> int:
        if parent[i] == i:
            return i
        return self.find_parent(parent, parent[i])

    def kruskal(self):
        self.mst_tree = []
        self.mst_tree = sorted(self.graph.items(), key=lambda x: x[1])
        count = 0
        for edge in self.mst_tree:
            i, j = edge[0], edge[1]
            if self.find_parent(self.graph, i)!= self.find_parent(self.graph, j):
                self.mst_tree.remove(edge)
                count += 1
        return count

    def average_length(self):
        return round(self.kruskal() / len(self.mst_tree), 10)

