        return -1

    # remove parts
    for part, length in parts_per_day.items():
        if part == last_part:
            length -= 1
        if length == 0:
            parts_per_day.pop(part)

    # count used parts
    count = 0
    for part, length in parts_per_day.items():
        count += length

    # return -1 if not all parts used
